(27820, '01 - A sto ćemo ljubav kriti 02 - Stani, stani Ibar vodo 03 - Djaurko mila 04 - Devojko moja 05 - Grana od bora 06 - Kad bi znala dilber Stano 07 - Oj, devojko djindjo moja 08 - Beograde grade 09 - Kada moja mladost prođe 10 - Ej, ja zagrizoh zeleniku jabuku 11 - Sve behara 12 - Kad se setim mila duso 13 - Devojka je posla 14 - Evo ovu rumen ruzu 15 - Sinoć kad sam poso 16 - Negde u daljini 17 - Kradem ti se u veceri 18 - S\' one strane Morave 19 - Gledaj me, draga', 0),
(27821, '01 - Malenim sokakom 02 - Ima te svuda i u svemu 03 - Sto ti je Stano mori 04 - Kad bi moja bila 05 - Snijeg pade na behar na voce 06 - Tuzno vetri gorom viju 07 - Oj, moja ruzo rumena 08 - Jesen prođe ja se ne ozeni 09 - Lov lovio momak mlad 10 - Sjetuje me majka 11 - Tebi majko misli lete 12 - Da zna zora 13 - Moj konjicu 14 - Na Moravi vodenica stara 15 - Kosio sam seno 16 - Jesen stize rana 17 - Zarasle su staze moje 18 - Jesen stigla, ogolele grane 19 - Edna pesna jas da zapeam (Festival „Valandovo” 1990) 20 - Begaj frose (Festival „Serenada na sirok sokak” 2002) 21 - Serenada (Festival „Ohrid fest” 1991)', 0),
(27822, '01 - Bas mi se ne da 02 - Adresa srca 03 - Samo da si rekla (Festival „Vogosca” 1988) 04 - Neveni 05 - Ne mogu da te zaboravim 06 - Gospode dragi 07 - Kako ću istinu priznati sebi 08 - Ako me ostavis (Festival „Ilidza” 1987) 09 - Kad god dodjes dobrodosla 10 - Volim te i tu boga nema 11 - Kaži mala 12 - Knjiga mog zivota 13 - Vekovima zubori Morava 14 - Nije mi lako, stari se polako 15 - Jedna reka u mom kraju 16 - Ostanimo prijatelji 17 - Odlazi, odlazi 18 - Pusti me da živim 19 - Sliku tvoju ljubim 20 - Podji u moju Srbiju 21 - Sega koga te nema (Festival „Ohrid fest” 2007)', 0),
(27823, '1. Lepo li je biti čobanica 2. Kišo tiho padaj 3. U đul bašti 4. Sedela sam kraj prozora 5. Zapevala sojka 6. Sreća je kad se voli 7. Drhti mi ruka sine 8. Zašto se mora rastajati 9. Suze na rastanku 10. Vrati se, zemlja te zove 11. Zar je ljubav tako teška 12. Živim i srce ne krivim 13. Oj ljubavi, ti jedina 14. Nek se peva pesma moja 15. Setićeš se mojih suza 16. Jesen se bliži', 0),
(27824, '1. Bolna leži Anđelija mlada 2. Devojka je zelen bor sadila 3. Duni mi, duni lađane 4. Kolenike vreteno 5. Nekad cvale bele ruže 6. Sinoć mi dragi dolazi 7. Livadica okolo jasenje 8. Kiša pada trava raste 9. Mila majko šalji me na vodu 10. Po mesečini kraj šimšira 11. Zarasle su staze ove 12. Vrti kolo 13. Tri devojke 14. Rumena mi ruža procvala 15. Kad sam sinoć pošla... 16. Kiša pada po livadi', 0),
(27825, '01. A sto ti je mila kceri 02. Sinoc ja i moja kona 03. Sini sini sjaj mesece 04. Stade se cvece rosom kititi 05. Cuvam ovce sve po dolovima 06. Obrase se vinogradi 07. Anica ovce cuvala 08. Ja posadih zelen bor 09. Oj javore javore 10. Ah moj Aljo crne oci 11. Cim rujna zora zarudi 12. Prela Mara 13. Alija se do jezera krade 14. Koliko je duga zima 15. Poletela sojka ptica', 0),
