(27832, '1. NA USKRS SAM SE RODILA 2. JA POSADIH JEDNU RUŽU BELU 3. TREPETLjIKA TREPETALA 4. OJ, LIVADO, OJ, ZELENA 5. JESEN STIŽE, JABUKE I KRUŠKE ZRIJU 6. MARKO I MILICA (duet sa Dobrivojem Topalovićem) 7. MNDRA MJA 8. FEĆICA MJA 9. NADOJNA 10. VEŠINA 11. MOJ OBRADE, POŽURI S` LIVADE 12. ZLATO MOJE 13. TU NU VRJEJ (duet sa Stanišom Paunovićem) 14. SUVO SENO, SUVA TRAVA 15. ŠTA ĆE MI ŽIVOT 16. ŠTA UČINI NOĆ ZVEZDANA 17. NAJLEPŠI PAR BI BILI 18. TUGO MOJA, KOŠULjO OD CVEĆA 19. DUGA PUTOVANjA (duet sa Radetom Marjanovićem) 20. DOSTA SUZA', 0),
