(27835, '1. PJESMA PODGORICI 2. PROĐOH SKORO CRNOM GOROM 3. DIVNA ZEMLjO MOJA 4. CRNOM GOROM NEK` SE ČUJE 5. SVI PLjEVALjSKI TAMBURAŠI 6. A KADA MI DRAGA DUŠO..... 7. RECI ŠTA TI FALI (duet sa Lepom Lukić) 8. PIVLjANKA 9. MOĆEVČIĆU, MALI CARIGRADE 10. JA PROŠETAH 11. OJ, MOJA RUŽO RUMENA 12. POLjEM SE VIJA 13. SVI MI KAŽU 14. CVIJET MOMČE 15. POLEĆE SOKO 16. POMRAČINA CIJELO SELO SPAVA 17. STARA VAROŠ 18. TAMO ĐE SE GUSLE ČUJU', 0),
